import TopBar from "./components/TopBar";
import Accordion from "./components/Accordion";

function App() {
    return (
        <div className="bg-black min-h-screen">
            <TopBar />
            <div className="pt-24">
                <Accordion 
                    title="ARTWORK" 
                    imageSrc="/Images/esofon.jpg" 
                    content={
                        <iframe 
                          width="420" 
                          height="345" 
                          src="https://www.youtube.com/embed/Ffe-7T6yDhU"
                          title="Artwork Video"
                        ></iframe>
                    }
                />
                <Accordion 
                    title="PERFORMANCES" 
                    imageSrc="/Images/performances.jpg" 
                    content={<p>This is the Performances section content.</p>}
                />
            </div>
        </div>
    );
}

export default App;
